    exit 1
  fi
fi
cd "$sfx_dir_name"
if [ "$?" -ne "0" ]; then
    echo "The temporary directory could not created due to a malfunction of the cd command. Is the CDPATH variable set without a dot?"
    exit 1
fi
sfx_dir_name=`pwd`
