    cd "$old_pwd"
    if [ ! "W $INSTALL4J_KEEP_TEMP" = "W yes" ]; then
      rm -R -f "$sfx_dir_name"
    fi
    exit $returnCode
  fi
fi
gunzip sfx_archive.tar.gz
if [ "$?" -ne "0" ]; then
